import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

import {
    MenuFoldOutlined,
    MenuUnfoldOutlined,
    UploadOutlined,
    UserOutlined,
    VideoCameraOutlined,
} from '@ant-design/icons';

//layout Component  
import { Layout, Menu, theme } from 'antd';
import MenuNav from '../MenuNav/MenuNav';

//componentes
import CompShowBlog from '../blog/showBlog';
import Prueba from '../Pruebas/prueba';
import Prueba2 from '../Pruebas/prueba2';
import Usurio from '../Pruebas/user';

const { Header, Sider, Content } = Layout;

  const LayoutFront = () => {
    const [collapsed, setCollapsed] = useState(false);

    const {
      token: { colorBgContainer },
    } = theme.useToken();

    return (
    <Router>
      <Layout>
        <Sider trigger={null} collapsible collapsed={collapsed}>
          <MenuNav></MenuNav>
        </Sider>
        <Layout className="site-layout">
          <Header
            style={{
              padding: 0,
              background: colorBgContainer,
            }}
          >
            {React.createElement(collapsed ? MenuUnfoldOutlined : MenuFoldOutlined, {
              className: 'trigger',
              onClick: () => setCollapsed(!collapsed),
            })}
          </Header>
          <Content
            style={{
              margin: '24px 16px',
              padding: 24,
              minHeight: 280,
              background: colorBgContainer,
            }}
          >
            <Routes>
                <Route path={'/'} exact  element={<CompShowBlog/>}/>
                <Route path={'/user'} exact  element={<Usurio/>}/>
                <Route path={'/prueba'} exact  element={<Prueba/>}/>
                <Route path={'/prueba2'} exact  element={<Prueba2/>}/>
            </Routes>
          </Content>
        </Layout>
      </Layout>
    </Router>
    );
  };
  export default LayoutFront;
